import { useState, useEffect } from "react"
import { useParams } from "react-router-dom"

export const MyRequest = () => {

    const {clientId} = useParams()
    const [genre, setGenres] = useState([])
    const [client, setClients] = useState({})


   useEffect( 
    () => { 
        fetch(`http://localhost:8088/requests?_expand=genre`)
            .then(response=>response.json())
            .then((genreInfo) => { 
                setGenres(genreInfo)
            })
    }, []
   )

    useEffect(
        () => {
            fetch(`http://localhost:8088/clients?&_expand=user&_embed=requests&clientId=${clientId}`)
                .then(response => response.json())
                .then((clientInfo) => {
                    const singleClient = clientInfo[0]
                    setClients(singleClient)
                })
        },
        [clientId]
    )


    return (
        <div className="requestInfo">
            <h2>My Request</h2>
            <div>Name: {client?.request?.fullName}</div>
            <div>Email: {client?.user?.email}</div>
            <div>Style of Music: {client.genre.type}</div>
            {/* <div>Start Date: {client?.requests?.startDate}</div>
            <div>End Date: {client?.requests?.endDate}</div>
            <div>Number of Songs: {client?.requests?.numOfSongs}</div> */}

        </div>

    )
}
